import React from "react";
import ReactDom from "react-dom";

function BookList() {
  return (
    <section>
      <Book />
      <Book />
    </section>
  );
}

const Book = () => {
  return (
    <article>
      <Image></Image>
    </article>
  );
};

const Image = () => (
  <img
    src="https://www.amazon.in/Grandmas-Bag-Stories-Sudha-Murty/dp/0143333623/ref=zg_bs_books_sccl_8/259-8653629-3420252?psc=1"
    alt=""
  />
);

ReactDom.render(<BookList />, document.getElementById("root"));
